    "2013-03-16T00:29:05.613362",nt"name": "new-mexico-excel-files-for-temperature-depth-logs",nt"isopen":
    false,nt"url": null,nt"notes": "These files represent 38 temperature-depth
    logs measured by the New Mexico Bureau of Geology & Mineral Resources over spring
    and summer of 2012 for inclusion into the DOE National Geothermal Data System for
    online access. Two probes were used, one sensitive to measurements in air and the
    other sensitive to measurements in water.  The probe type is labeled at the top
    of each file.  Wells with a shallow water table were logged with the water probe
    only - in this case the measurements above the water table are of little value.
     Wells that are dry or with a long vadose zone and little water were logged only
    with the air probe - all readings are useful in this case.  Some wells with a deep
    water table and long water column were logged with the air probe down to water table
    and with the water probe below the water table - all readings are useful in this
    case.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
